import React from "react";

const SearchResult = (props) => {
  //console.log(props.result);

  const spanStyles = {
      floar: "right"
  }
  return (
    <>
      <div className="row">
        <h5>{props.result.name}<span style = {spanStyles}>{props.result.rating}</span></h5>
        {/* <h6>{props.result.pricing}</h6> */}
        <p style = {{fontSize: "small", margin: "0, auto"}}>{props.result.description.slice(0, 100)}...</p>
      </div>
    </>
  );
};

export default SearchResult;
